"use client";
import { Button } from "@/components/ui/button";
import { Input } from "@/components/ui/input";
import { auth } from "@/firebase/config";
import axios from "axios";
import clsx from "clsx";
import Image from "next/image";
import { useState } from "react";
import { useAuthState } from "react-firebase-hooks/auth";
import { FaSpinner } from "react-icons/fa6";

interface EngagementData {
  username: string;
  profilePic: string;
  followers: number;
  averageLikes: number;
  averageComments: number;
  engagementRate: number;
}

export default function Engagement() {
  const [user] = useAuthState(auth);
  const [username, setUsername] = useState("");
  const [result, setResult] = useState<EngagementData | null>(null);
  const [loading, setLoading] = useState(false);

  const calculateEngagement = async () => {
    if (loading || !username) return;

    try {
      const token = await user?.getIdToken(true);
      setLoading(true);
      // const response = await axios.get(
      //   `http://localhost:5000/api/instagram/${username}`,
      //   {
      //     headers: {
      //       Authorization: token,
      //     },
      //   }
      // );
      const response = {
        data: {
          username: "cristiano",
          profilePic:
            "data:image/png;base64,",
          followers: 639504747,
          averageLikes: 9159374.96875,
          averageComments: 81734.375,
          engagementRate: 1.4450415555320344,
        },
      };
      setResult(response.data);
    } catch (error) {
      console.error("Error fetching engagement data:", error);
    } finally {
      setLoading(false);
    }
  };

  const handleKeyDown = (e: React.KeyboardEvent<HTMLInputElement>) => {
    if (e.key === "Enter") {
      calculateEngagement();
    }
  };

  return (
    <main className="bg-accent">
      <section className="container py-12 min-h-screen prose">
        <h1>Engagement Calculator</h1>
        <div className="flex items-center max-w-md gap-2">
          <Input
            value={username}
            onChange={(e) => setUsername(e.target.value.trim())}
            placeholder="Enter Instagram username"
            onKeyDown={handleKeyDown}
          />
          <Button onClick={calculateEngagement}>Calculate</Button>
        </div>

        <div
          className={clsx("flex gap-2 items-center", {
            "opacity-0": !loading,
          })}
        >
          <FaSpinner className="inline animate-spin" />
          <p className="mb-00">Getting instagram data, Please wait...</p>
        </div>

        {result && !loading && (
          <div>
            <div className="w-16 h-16 rounded-full overflow-hidden flex items-center justify-center">
              <Image
                src={result.profilePic}
                alt="profile pic"
                width={64}
                height={64}
                className="rounded-full transform scale-105"
              />
            </div>
            <pre>{JSON.stringify(result, null, 2)}</pre>
          </div>
        )}
      </section>
    </main>
  );
}
